import React, {useState} from 'react';

const PersonalPage = (props) => {
    const [people, setPeople] = useState([
        {
            firstName: 'John',
            lastName: 'Doe'
        }
    ])
    return (
        <div className="container">
            <div className="row">
                <div className="col">
                    <h2>Add a subject: </h2>
                </div>
            </div>
        </div>
    )
}

export default PersonalPage;
